import {
	Component,
	TemplateRef,
	ElementRef,
	Input,
	AfterViewInit,
	OnInit,
	ViewChild,
} from '@angular/core';
import { CommonModule } from '@angular/common';


import { CarouselSlideComponent } from '../../molecules/carousel-slide/carousel-slide.component';
import { CarouselDotComponent } from '../../molecules/carousel-dot/carousel-dot.component';

@Component({
	selector: 'app-carousel',
	templateUrl: './carousel.component.html',
	styleUrls: ['./carousel.component.scss'],
	imports: [CommonModule, CarouselSlideComponent, CarouselDotComponent],
	standalone: true,
})
export class CarouselComponent implements AfterViewInit {
	@ViewChild('slides') slides!: ElementRef<any>;
	selected: number = 0;
	minHeight: number = 318;
	setInterval: any = null;
	slideLength: number = 0;
	carousel: {
		slides: ElementRef[];
		slidemodified: number;
		slideSeleted: number;
		stylesSlides: {
			[index: number]: {
				zIndex: number;
				opacity: number;
				xtrans: number;
				scale: number;
			};
		};
	} = {
		slides: [],
		slidemodified: 0,
		slideSeleted: 0,
		stylesSlides: {},
	};

	ngAfterViewInit() {
		debugger;
		this.addSlides();
		this.slideLength = this.carousel.slides.length;
		this.arrange(1);
		this.createInterval();
	}

	createInterval() {
		this.setInterval = setInterval(() => {
			this.arrange(this.changeSlide());
		}, 4000);
	}

	changeSlide(operation: string = 'add') {
		switch (operation) {
			case 'add':
				this.selected =
					this.slideLength - 1 <= this.selected ? 0 : this.selected + 1;
				break;
			case 'subtract':
				this.selected =
					0 == this.selected ? this.slideLength - 1 : this.selected - 1;
				break;
		}
		return this.selected;
	}

	removeInterval() {
		clearInterval(this.setInterval);
	}

	_mod(n, m) {
		return ((n % m) + m) % m;
	}

	arrange(centerIndex) {
		const half = (this.carousel.slides.length - 1) / 2;

		const before = [];
		for (let i = centerIndex - 1; before.length < half; i--) {
			before.push(this.carousel.slides[this._mod(i, this.carousel.slides.length)]);
		}

		const after = [];
		for (
			let i = centerIndex + 1;
			after.length < this.carousel.slides.length - before.length - 1;
			i++
		) {
			after.push(this.carousel.slides[this._mod(i, this.carousel.slides.length)]);
		}

		this.carousel.stylesSlides[centerIndex].xtrans = 0;
		this.carousel.stylesSlides[centerIndex].scale = 1;
		this.carousel.stylesSlides[centerIndex].opacity = 1;
		this.carousel.stylesSlides[centerIndex].zIndex =
			Math.max(before.length, after.length) + 1;
		this.carousel.slideSeleted = centerIndex;

		[before, after].forEach((list, listIndex) => {
			let parentTrans = 0;

			list.forEach((item, i) => {
				this.carousel.stylesSlides[item.props.index].scale = 0.8 ** (i + 1);
				const absolute =
					105 * this.carousel.stylesSlides[item.props.index].scale * 1.125 +
					parentTrans;
				parentTrans = absolute;
				this.carousel.stylesSlides[item.props.index].xtrans =
					(listIndex == 0 ? -1 : 1) * absolute;

				this.carousel.stylesSlides[item.props.index].opacity = 0;

				this.carousel.stylesSlides[item.props.index].zIndex =
					Math.max(before.length, after.length) - i;
				this.carousel.slidemodified = item.props.index;
			});
		});
	}

	addSlides() {
		for (let i = 1; i < this.slides.nativeElement.children.length; i++) {
			this.carousel.slides.push(this.slides.nativeElement.children[i]);
		}
	}

	get style() {
		return {
			height: this.minHeight + 'px',
		};
	}
}

